import React from "react";
import {
  SafeAreaView,
  Text,
  View,
  TouchableOpacity,
  StyleSheet,
} from "react-native";
import { Ionicons } from "@expo/vector-icons";

export default function Home({ navigation }) {
  const renderHeader = () => {
    return (
      <View>
        <View
          style={{
            flexDirection: "row",
            justifyContent: "space-between",
            width: "55%",
            alignItems: "center",
            marginLeft: 25,
            marginTop: 10,
          }}
        >
          <TouchableOpacity onPress={() => navigation.goBack()}>
            <Ionicons name="chevron-back" size={34} color="black" />
          </TouchableOpacity>
          <Text
            style={{
              fontSize: 25,
              fontWeight: "bold",
            }}
          >
            Matchs
          </Text>
        </View>
        <View style={{ marginTop: 25, backgroundColor: 'lightgrey', height: 50,
    padding: 10,justifyContent: "center", alignItems: "center", width: '80%', alignSelf:'center', borderRadius: 25,}} >
      <TouchableOpacity style={{backgroundColor: 'yellow', height: 35,
    padding: 8,justifyContent: "center", alignItems: "center", width: '95%', alignSelf:'center', borderRadius: 25,}} >
          <Text style={{color:'blue'}}>Information</Text></TouchableOpacity>
        </View>
      </View>
    );
  };

  return <SafeAreaView style={styles.container}>{renderHeader()}</SafeAreaView>;
}

const styles = StyleSheet.create({
  container: {
    display: "flex",
    height: "100%",
    width: "100%",
  },
});
